create table tree3(id int not null, parentid int, text varchar(64) not null);

create index idx3 on tree3(id);
create index idx4 on tree3(id, parentid);
create index idx5 on tree3(parentid);
create reverse index idx6 on tree3(parentid);


select t.id, t.parentid from (select * from tree3 where id * id < parentid group by id, parentid limit 10) as t;
select t.parentid from (select * from tree3 where parentid is not null group by parentid desc limit 20) as t;
select t.parentid from (select * from tree3 group by parentid desc limit 20) as t;

drop table tree3;
